  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset consists of shorebird surveys
  conducted as part of the Program for Regional and International Shorebird Monitoring
  (PRISM). This dataset was derived from single-visit rapid area shorebird surveys
  in which 1-2 surveyors recorded all suspected breeding shorebirds within the plot
  boundary. These data were acquired over the Arctic Coastal Plain of Alaska during
  nine years between 1998 and 2008 (surveys not conducted in 2003 and 2005).\",\n\t\"license_title\":
